 A Praia da Pinheira é uma das praias mais frequentada de Palhoça, recebendo grande fluxo de turistas de outros estados. Localizada numa enseada a 35km do centro do município e a 48km de Florianópolis. É dividida em duas praias: Praia de Baixo e Praia de Cima, situadas em oposição uma a outra. 
 Hoje a Praia da Pinheira não é só um povoado com pescadores de tradição açoriana, lojas, farmácias, padarias e pousadas provam que o desenvolvimento chegou ali, porém o progresso não apagou as marcas que caracterizam a praia: os ranchos dos pescadores e a paz da convivência entre os visitantes e nativos. 
 O Nome conta-se que havia uma enseada muito linda, que era coberta por árvores de madeira leve e resistente, muito usada para a fabricação de bóias para as redes dos pescadores, o fruto desta árvore parecia-se com uma pinha (fruto do pinheiro) daí as árvores serem chamadas de pinheira. Como esta linda praia não tinha nome, os nativos chamaram-na de Pinheira. Praia de Cima Praia do Engenho, Praia das Cabras ou Praia de Cima, são alguns dos nomes dessa pequena, mas bela baía de águas limpas, que se completa com a ponta das andorinhas e o costão da Praia de Baixo. 
 A Praia de Cima é uma das poucas praias do município que além de sua rara beleza, abriga banhistas do vento sul pela sua posição geográfica. -

